import ResumeData from "./resumeData"

export default function ContactBox() {
    return (
        <div className="resumeContainer">
            <ul className="contactBox">
                {ResumeData.map((contact) => (
                    <li className="ContactInfoList" key={contact.type}>
                        {contact.type}
                        <p href={contact.address}>
                            {contact.label}
                        </p>
                    </li>
                ))}
            </ul>
        </div>
    );
}
